import React, { useState } from 'react';

function SelfDiagnosis() {
  const [answer1, setAnswer1] = useState(null);
  const [answer2, setAnswer2] = useState(null);
  const [answer3, setAnswer3] = useState(null);
  const [answer4, setAnswer4] = useState(null);
  const [answer5, setAnswer5] = useState(null);

  return (
    <div className="self-diagnosis-container" style={{ maxWidth: 500, margin: '40px auto', padding: 24, background: '#fff', borderRadius: 12 }}>
      <h2>Self Diagnosis</h2>
      {/* Question 1 */}
      <div style={{ marginBottom: 24 }}>
        <strong>1) Apakah kendaraan Anda masih bisa menyala dan beroperasi?</strong>
      </div>
      <div style={{ marginBottom: 24 }}>
        <button
          style={{ marginRight: 16, padding: '8px 24px' }}
          onClick={() => { setAnswer1('no'); setAnswer2(null); setAnswer3(null); setAnswer4(null); setAnswer5(null); }}
        >
          Tidak
        </button>
        <button
          style={{ padding: '8px 24px' }}
          onClick={() => setAnswer1('yes')}
        >
          Ya
        </button>
      </div>
      {/* If "Tidak" */}
      {answer1 === 'no' && (
        <div style={{ color: 'red', fontWeight: 'bold' }}>
          Segera hubungi bengkel terdekat karena kemungkinan memiliki masalah serius.<br />
          Silahkan konsultasikan pada mekanik dan kemungkinan aki anda lemah.
        </div>
      )}
      {/* If "Ya" to Q1, show Q2 */}
      {answer1 === 'yes' && (
        <>
          <div style={{ marginBottom: 24 }}>
            <strong>2) Apakah Anda merasa performa kendaraan Anda berkurang?</strong>
          </div>
          <div style={{ marginBottom: 24 }}>
            <button
              style={{ marginRight: 16, padding: '8px 24px' }}
              onClick={() => { setAnswer2('no'); setAnswer3(null); setAnswer4(null); setAnswer5(null); }}
            >
              Tidak
            </button>
            <button
              style={{ padding: '8px 24px' }}
              onClick={() => setAnswer2('yes')}
            >
              Ya
            </button>
          </div>
          {answer2 === 'yes' && (
            <div style={{ color: 'orange', fontWeight: 'bold' }}>
              Jika iya maka mungkin anda perlu melakukan servis atau tune up.
            </div>
          )}
          {answer2 === 'no' && (
            <>
              <div style={{ marginBottom: 24 }}>
                <strong>3) Apakah lampu indikator Check Engine menyala saat kendaraan beroperasi?</strong>
              </div>
              <div style={{ marginBottom: 24 }}>
                <button
                  style={{ marginRight: 16, padding: '8px 24px' }}
                  onClick={() => { setAnswer3('no'); setAnswer4(null); setAnswer5(null); }}
                >
                  Tidak
                </button>
                <button
                  style={{ padding: '8px 24px' }}
                  onClick={() => setAnswer3('yes')}
                >
                  Ya
                </button>
              </div>
              {answer3 === 'yes' && (
                <div style={{ color: 'red', fontWeight: 'bold' }}>
                  Jika iya maka segera lakukan perbaikan ke bengkel terdekat.
                </div>
              )}
              {answer3 === 'no' && (
                <>
                  <div style={{ marginBottom: 24 }}>
                    <strong>4) Apakah lampu Oil Engine menyala saat kendaraan beroperasi?</strong>
                  </div>
                  <div style={{ marginBottom: 24 }}>
                    <button
                      style={{ marginRight: 16, padding: '8px 24px' }}
                      onClick={() => { setAnswer4('no'); setAnswer5(null); }}
                    >
                      Tidak
                    </button>
                    <button
                      style={{ padding: '8px 24px' }}
                      onClick={() => setAnswer4('yes')}
                    >
                      Ya
                    </button>
                  </div>
                  {answer4 === 'yes' && (
                    <div style={{ color: 'red', fontWeight: 'bold' }}>
                      Jika iya maka segera lakukan perbaikan ke bengkel terdekat untuk pengecekan mesin secara detail.
                    </div>
                  )}
                  {answer4 === 'no' && (
                    <>
                      <div style={{ marginBottom: 24 }}>
                        <strong>5) Apakah lampu Coolant Merah menyala saat kendaraan beroperasi?</strong>
                      </div>
                      <div style={{ marginBottom: 24 }}>
                        <button
                          style={{ marginRight: 16, padding: '8px 24px' }}
                          onClick={() => setAnswer5('no')}
                        >
                          Tidak
                        </button>
                        <button
                          style={{ padding: '8px 24px' }}
                          onClick={() => setAnswer5('yes')}
                        >
                          Ya
                        </button>
                      </div>
                      {answer5 === 'yes' && (
                        <div style={{ color: 'red', fontWeight: 'bold' }}>
                          Jika iya maka segera lakukan perbaikan ke bengkel terdekat untuk diperiksa sistem pendinginan mesin.
                        </div>
                      )}
                      {answer5 === 'no' && (
                        <div style={{ color: 'green', fontWeight: 'bold' }}>
                          Kemungkinan kendaraan anda masih baik-baik saja.
                        </div>
                      )}
                    </>
                  )}
                </>
              )}
            </>
          )}
        </>
      )}
    </div>
  );
}

export default SelfDiagnosis;
